import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { useNavigate, useLocation, Link } from 'react-router-dom';

import Home from "./routes/Home.js";
import Login from "./routes/Login.js";
import ModifyProfile from "./routes/ModifyProfile.js";
import Registration from "./routes/Registration.js";
import SelectUserType from "./routes/SelectUserType.js";

import { createBrowserRouter, RouterProvider } from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home/>
  },
  {
    path: "/home",
    element: <Home/>
  },
  {
    path: "/login",
    element: <Home/>
  },
  {
    path: "/modify_profile",
    element: <ModifyProfile/>
  },
  {
    path: "/registration",
    element: <Registration/>
  },
  {
    path: "/select_user_type",
    element: <SelectUserType/>
  },
])

{/* <Route component = { Home }  path="/" exact />
<Route component = { Home }  path="/home" />
<Route component = { Login }  path="/login" />
<Route component = { ModifyProfile }  path="/modify_profile" />
<Route component = { Registration }  path="/registration" />
<Route component = { SelectUserType }  path="/select_user_type" /> */}

const Router = (props) => {

    return(
        <React.StrictMode>
            <RouterProvider/>
        </React.StrictMode>
    )
}

export default Router;
